import React from "react";
import { Navigate, Route } from "react-router-dom";
import Signup from "./components/Signup/Signup";

const SignupGuard = ({ isLoggedIn }) => {
  return isLoggedIn ? <Navigate to="/" /> : <Signup />;
};

export default SignupGuard;
